import React, { Component } from 'react';
import '../App.css';
import Axios from 'axios';
class Index extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      ApiWeather: []
    };
  }

  componentDidMount() {
    Axios.get('http://api.openweathermap.org/data/2.5/weather?q=Galway&appid=d24d19a0fa6b2334b4039e272b3c79ef')
      .then(response => {
        this.setState({ ApiWeather: response.data.weather });
        this.setState({ ApiWeather: response.data.weather.description });
      })
      .catch(function (error) {
        console.log(error);
      })
  }
  //<h2>It is {new Date().toLocaleTimeString()}.</h2>

  render() {
    var { ApiWeather } = this.weather;
    return (
      <ul>
        {ApiWeather.map(weather => (


          <li key={weather.description}>
            <div className="ViewSongs">
              <h2>Artist name</h2>
              <h3>Song Title</h3>
              <h3>Times Streamed</h3>
              <br></br>
            </div>




          </li>

        ))}
      </ul>
    );
  }
}

export default Index;
